import React from "react";
import circle from "../assets/circle.png";

function Pageseven() {
  return (
    <div>
      <div>
        <img src={circle} alt="" />
      </div>
      <div>
        <p>Our Clients</p>
        <p>
          Love form happy clients from
          <br />
           the entire world
        </p>
      </div>
    </div>
  );
}

export default Pageseven;
